import './Accueil.css'
import useLocoScroll from './hooks/useLocoScroll.js';
import Rotate from 'react-reveal';
import logo_rond from '../global/Nav/images/logo_rond.png';
import Pulse from 'react-reveal/Pulse';
import React, { useRef, useEffect, useState } from 'react';

function Accueil() {
    const [preloader, setPreloader] = useState(true);





    useEffect(() => {
        // Votre fonction ici
        console.log('La page a changé !');
      }, []);


    
    
    useLocoScroll(!preloader);


    const [timer, setTimer] = useState(1);
    const id = useRef(null);

    const clear = ()=>{
        window.clearInterval(id.current);
        setPreloader(false);
    }

    useEffect(()=>{
        id.current = window.setInterval(()=>{
            setTimer((timer)=> timer-1)

        },1000 )

    }, [])

    useEffect(()=>{
        if(timer ===0){
            clear();
        }

    }, [timer])



    return(

        <span>
            {preloader?(
            
            <div className='loader'>
                <h1> chargement</h1>

            </div>)
            :(

            <div id="main-container" className="main-container" data-scroll-container> 
            <Pulse>
                <div className='div_b2b_records' data-scroll-section id="sec1">
                    <span className='span_b2b' >
                        <span className='titre_b2b' data-scroll-position="top" data-scroll data-scroll-direction="horizontal" data-scroll-speed="-3">BICRAVEURS2BASS</span>
                        <span className='titre_b2b titre_b2b--contour' data-scroll-position="top" data-scroll data-scroll-direction="horizontal" data-scroll-speed="-6">BICRAVEURS2BASS</span>
                        <span className='titre_b2b titre_b2b--contour' data-scroll-position="top" data-scroll data-scroll-direction="horizontal" data-scroll-speed="-9">BICRAVEURS2BASS</span>
                    </span>
                    <span className='span_records' >
                        <span className='titre_b2b' data-scroll-position="top" data-scroll data-scroll-direction="horizontal" data-scroll-speed="3">RECORDS</span>
                        <span className='titre_b2b titre_b2b--contour' data-scroll-position="top" data-scroll data-scroll-direction="horizontal" data-scroll-speed="6">RECORDS</span>
                        <span className='titre_b2b titre_b2b--contour' data-scroll-position="top" data-scroll data-scroll-direction="horizontal" data-scroll-speed="9">RECORDS</span>
                    </span>
                </div>
                </Pulse>



 
                <div className='section2' data-scroll-section id="sec2" >
                        <h1 className='label_ind blanc'  data-scroll-position="left" data-scroll data-scroll-direction="vertical" data-scroll-speed="-4">LABEL INDÉ</h1>      
                        <h1 className='label_ind'  data-scroll-position="left" data-scroll data-scroll-direction="vertical" data-scroll-speed="-1">NORMAND</h1>
                </div>
                
                <div className='section3' data-scroll-section id="sec3" >

                       <img className='logo_rond' data-scroll-target="#sec2" data-scroll-position="left" data-scroll data-scroll-direction="horizontal" data-scroll-speed="-3" src={logo_rond}></img>

                </div>

                <div className='section4' >
                   <span data-scroll-section id="sec4"   className='span_genre_accueil --1'>
                        <h3  className='genre_accueil --1'  data-scroll data-scroll-sticky data-scroll-target="#sec3" data-scroll-direction="horizontal" data-scroll-speed="6">HARDCORE</h3>
                        <h3  className='genre_accueil --1' data-scroll-position="top" data-scroll data-scroll-sticky data-scroll-target="#sec3" data-scroll-direction="horizontal" data-scroll-speed="3">GABBER</h3>
                    </span>
                    <span data-scroll-section id="sec4"   className='span_genre_accueil --2'>
                        <h3  className='genre_accueil --2' data-scroll-position="top" data-scroll data-scroll-sticky data-scroll-target="#sec3" data-scroll-direction="horizontal" data-scroll-speed="-3">DOOMCORE</h3>
                        <h3  className='genre_accueil --2' data-scroll-position="top" data-scroll data-scroll-sticky data-scroll-target="#sec3" data-scroll-direction="horizontal" data-scroll-speed="-3">TECHNO</h3>
                    </span>
                </div>

                <div className='section5' data-scroll-section id="sec5">
                <Rotate >
                    <h4 className='titre_pres' data-scroll-position="top" data-scroll-target="#sec4" data-scroll  data-scroll-direction="vertical" data-scroll-speed="-4">PRODUCTION</h4>
                </Rotate>
                    <h4 className='titre_pres' data-scroll-position="top" data-scroll-target="#sec4" data-scroll  data-scroll-direction="vertical" data-scroll-speed="-4.5">DJ SETS</h4>
                    <h4 className='titre_pres' data-scroll-position="top" data-scroll-target="#sec4" data-scroll  data-scroll-direction="vertical" data-scroll-speed="-5">EVENTS</h4>
                </div>































            </div>
            )}
        </span>

    )
}

export default Accueil;
